    strDescriptionIT = "Il Lille Olympique Sporting Club, noto come LOSC o semplicemente come Lille (in italiano anche Lilla), è una società calcistica francese della città di Lilla, capoluogo del dipartimento del Nord. Milita attualmente nella Ligue 1, massima divisione del campionato francese di calcio.\r\n\r\nGioca le proprie partite casalinghe allo stadio Pierre Mauroy di Villeneuve d'Ascq, impianto da oltre 50 000 posti a sedere che dal 2012 ha rimpiazzato lo stadio Lille-Metropole.\r\n\r\nFondato nel 1944 dalla fusione di Olympique Lillois (che nel 1932-1933 vinse il primo campionato francese) e di SC Fives, nella sua storia il Lilla ha vinto quattro campionati francesi (1945-1946, 1953-1954, 2010-2011, 2020-2021) e sei Coppe di Francia (1945-1946, 1946-1947, 1947-1948, 1952-1953, 1954-1955 e 2010-2011), oltre ad una Coppa Intertoto nel 2004.\r\n\r\nLa maggiore rivalità è con il Lens, con cui il Lilla disputa il derby du Nord.",
