    strDescriptionEN = "Olympique Lyonnais (commonly referred to as simply Lyon, or OL) (Euronext: OLG) is a French association football club based in Lyon. It plays in France's highest football division, Ligue 1. The club was formed as Lyon Olympique Universitaire in 1899, according to many supporters and sport historians, but was nationally established as a club in 1950. The club's most successful period has been the 21st century. The club won its first ever Ligue 1 championship in 2002, starting a national record-breaking streak of seven successive titles. Lyon has also won a record seven Trophée des Champions, five Coupe de France titles and three Ligue 2 Championships.\r\n\r\nLyon has participated the UEFA Champions League 12 times, and during the 2009–10 season, reached the semi-finals of the competition for the first time after three previous quarter-final appearances. Olympique Lyonnais plays its home matches at the 40,500-seat Stade de Gerland in Lyon. In 2015/2016, their new stadium will be ready, tentatively named OL Land, in Décines-Charpieu, a suburb of Lyon. The club's home colours are white, red and blue. Lyon was a member of the G14 group of leading European football clubs and are founder members of its successor, the European Club Association.\r\n\r\nOlympique Lyonnais is one of the popular clubs in France. About 11% of the country's population support the club. Lyon shares this number with Paris Saint-Germain and trails only Olympique de Marseille. The club's nickname, Les Gones, means \"The Kids\" in Lyon's regional dialect of Arpitan. The chairman of Lyon is Jean-Michel Aulas and the club is managed by Hubert Fournier. Olympique Lyonnais also has a successful women's football team having won its league a record nine times. The women's team has also won three Challenge de France titles and the UEFA Women's Champions League in 2011 and 2012.",
    strDescriptionDE = null,
    strDescriptionFR = "L'Olympique lyonnais, couramment abrégé en OL, est un club de football français fondé en 1950. Le club, basé dans le quartier de Gerland, est présidé depuis juin 1987 par Jean-Michel Aulas et l'équipe est entraînée par Hubert Fournier depuis le 23 mai 2014. Il évolue depuis 1989 en Ligue 1.\r\n\r\nL'Olympique lyonnais évolue dans le Stade de Gerland et s'entraîne au centre Tola Vologe, à Lyon. Il possède à son palmarès sept titres - obtenus consécutivement - de champion de France, cinq Coupes de France et une Coupe de la Ligue, ce qui en fait l'un des clubs les plus titrés du championnat de France.\r\n\r\nLe club connaît son apogée au cours des années 2000 avec sept titres consécutifs de champion de France, ce qui constitue un record françaisnote 2, entre 2002 et 2008, une Coupe de France et une Coupe de la Ligue. La section féminine du club a remporté quant à elle le championnat féminin à neuf reprisesnote 3. En 2007, les sections masculines et féminines remportent chacune leur championnat de France, pour la première fois dans l'histoire du football français. En 2008, l’Olympique lyonnais fait mieux en remportant les deux doublés coupe-championnat, homme et femme. Depuis le milieu des années 2000, la section féminine occupe les plus hauts niveaux du football féminin européen (2 titres successifs en Ligue des champions).\r\n\r\nSur le plan international, le club participe régulièrement à la plus prestigieuse des coupes européennes, la Ligue des champions. Après avoir été membre du G14, organisation des clubs les plus importants et riches d'Europe, jusqu'à sa dissolution en janvier 2008, il fait partie des fondateurs de l'association européenne des clubs.\r\n\r\nAujourd'hui, il est considéré comme l'un des clubs majeurs du football européen, avec douze qualifications en Ligue des champions d'affilée. Depuis 2011, le club rhodanien se base de plus en plus sur son centre de formation. L'Olympique lyonnais est le club français qui a joué le plus de matches européens, puisqu'il est à 212 matches (dont 107 succès) depuis ses débuts dans le fief de l'Inter Milan le 10 décembre 1958.",
